package com.github.rviehmann.aoc2018;

import static java.lang.Character.isUpperCase;

public class Day05 {

    // From: https://adventofcode.com/2018/day/5/input
    private static final String INPUT =
            "";

    private static String doAllReductionRounds(String input) {
        System.out.println("doAllReductionRounds: Input has length: " + input.length());
        String currentState = input;
        String newState;
        while (true) {
            newState = doOneReductionRound(currentState);
            if (newState.equals(currentState)) break;
            currentState = newState;
        }
        System.out.println("doAllReductionRounds: Output has length: " + newState.length());
        System.out.println("doAllReductionRounds: Output is: '" + newState + "'.");
        return newState;
    }

    private static String doOneReductionRound(String input) {
        for (int i = 0; i < input.length() - 1; i++) {
            char current = input.charAt(i);
            char next = input.charAt(i + 1);
            if (areOpposites(current, next)) {
                // Skip over this one and the next one
                StringBuilder output = new StringBuilder();
                if (i > 0) output.append(input.substring(0, i));
                if (i < input.length() - 2) output.append(input.substring(i + 2));
                return output.toString();
            }
        }
        return input;
    }

    private static boolean areOpposites(char c1, char c2) {
        String s1 = ((Character) c1).toString();
        String s2 = ((Character) c2).toString();
        return s1.equalsIgnoreCase(s2)
                && ((isUpperCase(c1) && !isUpperCase(c2)) || (!isUpperCase(c1) && isUpperCase(c2)));
    }

    public static void testWithExamplesForPuzzle1() {
        System.out.println("### Day 05: Examples for puzzle 1 ###");

        String result = doAllReductionRounds("dabAcCaCBAcCcaDA");
        System.out.println("Result of reduction: '" + result + "'.");

        String result2 = doAllReductionRounds("AadabAcCaCBAcCcaDAzZ");
        System.out.println("Result of reduction: '" + result2 + "'.");
    }

    public static long doPuzzle1() {
        String result = doAllReductionRounds(INPUT);
        return result.length();
    }

    public static long doPuzzle2() {
        // TODO
        return 0;
    }
}
